import "./App.css";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";

import Home from "./Pages/Home";
import AboutUs from "./Pages/AboutUs";

function App() {
  return (
    <Router>
      <Switch>
        <Route to="/" exact component={Home} />
        <Route to="/aboutUs" exact component={AboutUs} />
      </Switch>
    </Router>
  );
}

export default App;
